import React from 'react';
import "./portofolio.scss";


export default function Portofolio() {
  return (
    <div className="portofolio" id="portofolio">
        <h1>Fotografii</h1>

        <ul>
          <li>Featured</li>
          <li>Web App</li>
          <li>Mobile App</li>
          <li>Design</li>
          <li>Featured</li>

          <div className="container">
            <div className="item">
              
            </div>
          </div>

        </ul>
    </div>
  )
}
